import React from 'react';
import './Home.css';
// Update these imports to match your actual image file names and extensions
import linkedinIcon from '../assets/linkedin.png';
import githubIcon from '../assets/github.png';
import profilePic from '../assets/pic.jpg';  // or 'pic.jpg' if you're using jpg format

const Home = () => {
  return (
    <section className="home">
      <div className="home-info">
        <h1>Siddhi Gawade</h1>
        <h2>Web Developer</h2>
        <p>
          Tech-savvy computer student proficient in multiple programming languages,
          eager to apply my coding prowess and problem-solving skills to real-world
          challenges.
        </p>
        <div className="btn-sci">
          <a href="#" className="btn">Download CV</a>
          <a href="#" className="btn">Download Resume</a>
          <div className="sci">
            <a href="#"><img src={linkedinIcon} alt="linkedin" /></a>
            <a href="#"><img src={githubIcon} alt="github" /></a>
          </div>
        </div>
      </div>

      <div className="home-img">
        <div className="img-box">
          <div className="img-item">
            <img src={profilePic} alt="Siddhi's Pic" />
          </div>
        </div>
      </div>
    </section>
  );
};

export default Home;
